import React, { Component } from 'react';
import './App.css';

import contacts from './contacts.json';

class App extends Component {
  render() {
    return (
      <div className="App">
        {contacts.map(singleContact => {
          return <div>{singleContact}</div>;
        })}
      </div>
    );
  }
}

export default App;
